#!/usr/bin/python
# coding=utf8

import random as r

def simple(A):
  """
  Generate simple graph from graph represented by adjacency matrix A.
  Function returns adjacency matrix S of simple graph.
  """
  S = []
  for a in A:
    S.append([1 if i > 0 else 0 for i in a])
  return S

def gnp(n, p):
  """
  Generate Erdos-Renyi random graph with n nodes and edge probability p.
  Function returns triple consisting of graph name `G(n,p)`, adjacency matrix A and node labels set to None.
  """
  A = [[0 for _ in range(n)] for _ in range(n)]
  for i in range(n):
    for j in range(i + 1, n):
      if r.random() < p:
        A[i][j] = 1
        A[j][i] = 1
  return ('G(n,p)', A, None)

def gnm(n, m):
  """
  Generate Erdos-Renyi random graph with n nodes and m edges.
  Function returns triple consisting of graph name `G(n,m)`, adjacency matrix A and node labels set to None.
  """
  A = [[0 for _ in range(n)] for _ in range(n)]
  for _ in range(m):
    i = r.randint(0, n - 1)
    j = r.randint(0, n - 1)
    A[i][j] += 1
    A[j][i] += 1
  return ('G(n,m)', A, None)

def gnk(n, k):
  """
  Generate Erdos-Renyi random graph with n nodes and average degree k.
  Function returns triple consisting of graph name `G(n,k)`, adjacency matrix A and node labels set to None.
  """
  G = gnm(n, int(round(n * k / 2)))
  return ('G(n,k)', G[1], G[2])

def component(A, N, i):
  """
  Find connected component of node i in graph represented by adjacency matrix A considering only nodes in list N.
  Function returns list ofnode indices C in connected component of node i and removes them from list N.
  """
  C = []
  S = []
  N.remove(i)
  S.append(i)
  while S:
    i = S.pop(0)
    C.append(i)
    for j in range(len(A)):
      if A[i][j] and j in N:
        N.remove(j)
        # S.append(j) # breath-first
        S.insert(0, j) # depth-first
  return C

def components(A):
  """
  Find connected components of graph represented by adjacency matrix A.
  Function returns list of lists C of node indices in connected components implemented by `component(A, N, i)`.
  """
  C = []
  N = list(range(len(A)))
  while N:
    C.append(component(A, N, N[0]))
  return C

def clusterings(A):
  """
  Compute clustering coefficient for each node in graph represented by adjacency matrix A.
  Function returns dictionary of clustering coefficients C for each node represented by its index.
  """
  C = {}
  for i in range(len(A)):
    C[i] = 0.0
    k = sum(A[i])
    if k > 1:
      for j in range(len(A)):
        for l in range(len(A)):
          if A[i][j] and A[i][l] and A[j][l]:
            C[i] += 1.0 / k / (k - 1)
  return C

def clustering(A):
  """
  Compute average node clustering coefficient for graph represented by adjacency matrix A.
  Function returns average node clustering coefficient C implemented by `clusterings(A)`.
  """
  return sum([C for C in clusterings(A).values()]) / len(A)

def info(G):
  """
  Print out standard information of graph represented by adjacency matrix A.
  Method prints out graph name and type, number of (isolated) nodes and (self) edges, average node degree, size and number of connected components, and average node clustering coefficient.
  """
  (name, A, L) = G
  S = simple(A)
  n = len(A)
  k = [sum(a) for a in A]
  m = sum(k) / 2
  l = 0
  for i in range(n):
    if A[i][i] > 0:
      l += A[i][i] / 2
  C = components(A)

  print("{0:>12s} | '{1:s}'".format('Graph', name))
  print("{0:>12s} | '{1:s}'".format('Type', ('x' if L is not None else '0') + ('--' if A == S else '==') + ('y' if L is not None else '1')))
  print("{0:>12s} | {1:,d} ({2:,d})".format('Nodes', n, k.count(0)))
  print("{0:>12s} | {1:,d} ({2:,d})".format('Edges', m, l))
  print("{0:>12s} | {1:.4f}".format('Degree', 2.0 * m / n))
  print("{0:>12s} | {1:.1f}% ({2:,d})".format('LCC', 100.0 * max([len(c) for c in C]) / n, len(C)))
  print("{0:>12s} | {1:.4f}\n".format('C', clustering(A)))

